REPLACE INTO `assessment_main` (`id`, `title`, `description`, `no_levels`, `type`, `status`, `active_flag`, `route_url`) VALUES
	(1, 'Accounting principles and procedures', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 1, 'mandatory', NULL, NULL, 'accounting_principles'),
	(2, 'Business planning', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 1, 'mandatory', NULL, NULL, 'business_planning'),
	(3, 'Client care', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 2, 'mandatory', NULL, NULL, 'client_care'),
	(5, 'Conduct rules, ethics and professional practice', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 3, 'mandatory', NULL, NULL, 'conduct_rules'),
	(6, 'Conflict avoidance, management and dispute resolution procedures', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 1, 'mandatory', NULL, NULL, 'conflict_avoidance'),
	(7, 'Data management', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 1, 'mandatory', NULL, NULL, 'data_management'),
	(8, 'Health and safety', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 2, 'mandatory', NULL, NULL, 'health_safety'),
	(9, 'Sustainability', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 1, 'mandatory', NULL, NULL, 'sustainability'),
	(10, 'Team working', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 1, 'mandatory', NULL, NULL, 'team_working'),
	(11, 'Inspection', 'This competency is about property and asset inspection, fundamental to providing accurate advice on machinery and business assets or property. It is important that candidates are able to demonstrate knowledge and understanding of the core requirements of property and asset inspection. Assessors will be seeking confirmation that all candidates have good knowledge of building construction, location analysis and defects.', 3, 'professional-core', NULL, NULL, 'inspection'),
	(12, 'Valuation', 'This competency is about the preparation of property valuation advice, made in accordance with the appropriate valuation standards, to enable clients make informed decisions.', 3, 'professional-core', NULL, NULL, 'valuation'),
	(13, 'Measurement of Land and Property', 'This competency is relevant to all data capture and measurement of land, property and assets.', 2, 'professional-core', NULL, NULL, 'measurement'),
	(4, 'Communication and negotiation', 'Demonstrate knowledge and understanding of the principles, behaviour and dynamics of working in a team.', 2, 'mandatory', NULL, NULL, 'communication_negotiation'),
	(14, 'Access and Rights over Land ', 'This competency is about access and easements for power, water and communications infrastructure including way-leaves and the differing methods of acquisition and compensation negotiations, including fees.', 3, 'Technical - Optional ', NULL, NULL, 'Access and Rights over Land '),
	(15, 'Conflict Avoidance, Management, and Dispute Resolution Procedures ', 'This competency covers knowledge, understanding and application of a range of processes related to dispute/ conflict avoidance, management and dispute resolution.', 3, 'Technical - Optional ', NULL, NULL, 'conflict_avoidance'),
	(16, 'Auctioneering ', 'This competency reflects the complex factors governing auctioneering including online auctions. It includes aspects of law of sale and contract, misdescription etc., as well as requiring the candidate to have knowledge of the auction process and reasons for recommending sale by auction (or otherwise) over and above other methods of disposal.', 3, 'Technical - Optional ', NULL, NULL, 'Auctioneering ');
