REPLACE INTO `privacy_policy` (`id`, `policycontent`, `user_id`, `created_at`, `status`, `last_modified`) VALUES
	(1, '<section>\r\n    <div>\r\n        <div>\r\n            <div>\r\n                <div>\r\n                    <div>\r\n                        <h3>Privacy Policy</h3>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<section>\r\n    <div>\r\n        <div>\r\n            <div><br></div>\r\n        </div>\r\n        <div>\r\n            <div>\r\n                <div>\r\n                    <div>\r\n                        <h4>Class Valuation&rsquo;s Commitment To Privacy</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>Your privacy is very important to us. Part of our operation of this website involves the collection and use of information about you. This privacy policy explains what type of information we collect and what we do with that information to allow you to make choices about the way your information is collected and used. This privacy policy may change from time to time, so please check it often.</div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>What Information Do We Collect?</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>In general, you can visit this website without identifying who you are or revealing any information about yourself. Information collected online can generally be categorized as anonymous or personally identifiable. Anonymous information is information that cannot be connected to the identity of a specific individual. Personally identifiable information is information that specifically identifies a particular user, such as name, address, or phone number. An example of anonymous information is the fact that, while this website may record the number of visits to a particular page that occur in a given period of time, it does not necessarily tell us the names or other identifying information of every visitor. Many users of this website will choose not to provide any personally identifiable information; therefore, those individuals are anonymous to us, and any data collected about their use of this website is anonymous information.</p>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>Automatic Anonymous Information</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>When you visit our site, we collect certain technical and routing information about your computer. For example, we log environmental variables such as browser type, operating system and CPU speed, and the Internet Protocol (IP) address of your originating Internet Service Provider, to try to bring you the best possible service. We also record search requests and results to try to ensure the accuracy and efficiency of our search engine. We use your IP address to track your use of the site, including pages visited and the time spent on each page. We collect this information and use it to measure the use of this website and to improve its content and performance. All of the information that is automatically submitted to us by your browser is considered anonymous information. To the extent we share such information with third parties, it is not traceable to any particular user and will not be used to contact you.</p>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>Cookies</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>This site uses cookies. Cookies are small data files, typically made up of a string of text and numbers, that assign you a unique identifier. This information enables your computer to have a &ldquo;dialogue&rdquo; with our site and permits us to administer our site more efficiently and to provide a more tailored and user-friendly service to you. You may set your browser to notify you when you receive a cookie or to prevent cookies from being sent; if you do so, this may limit the functionality we can provide you when you visit our site. Third parties that link on this site may use cookies or collect other information when you go to their site. We do not control the collection or use of your information by these companies. You should contact these companies directly if you have any questions about their collection or use of information about you.</p>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>How Do We Use Information We Collect?</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>We collect personally identifiable information only for providing the services you request, generating statistical studies, conducting marketing research, improving products and services, sending you surveys, and notifying you of new products and any other changes to our site or services that may affect you. When you submit personally identifiable information to us, you understand that you are agreeing to allow us to access, store, and use that information for those purposes.</p>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>We Will Not Sell Or Give Any Personally Identifiable Information To Any Third Parties.</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>We may be required by law enforcement or judicial authorities to provide personally identifiable information to the appropriate governmental authorities. If requested by law enforcement or judicial authorities, we will provide this information on receipt of the appropriate documentation. We may also release information to law enforcement agencies or other third parties if we feel it is necessary to protect the safety and welfare of our personnel or to enforce our terms of use.</p>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>Security</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>We operate secure data networks protected by industry standard firewall and password protection systems. Our security and privacy policies are periodically reviewed and enhanced as necessary, and only authorized individuals have access to the personally identifiable information provided by our users. We do not, however, guarantee that unauthorized, inadvertent disclosure will never occur.</p>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <h4>Transfer Of Customer Information</h4>\r\n                    </div>\r\n                </div>\r\n                <div>\r\n                    <div>\r\n                        <p>Customer lists and information are properly considered assets of a business. Accordingly, if we merge with another entity or if we sell our assets to another entity, our customer lists and information, including personally identifiable information you have provided us, would be included among the assets that would be transferred.</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div><br></div>\r\n    </div>\r\n</section>', NULL, NULL, NULL, NULL);
